DROP TABLE IF EXISTS `internship`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `internship` (
  `id` bigint NOT NULL AUTO_INCREMENT,
  `class_id` varchar(100) DEFAULT NULL,
  `company` varchar(255) DEFAULT NULL,
  `created_at` datetime(6) DEFAULT NULL,
  `final_file` varchar(1000) DEFAULT NULL,
  `is_lock` bit(1) DEFAULT NULL,
  `modified_at` datetime(6) DEFAULT NULL,
  `note` varchar(255) DEFAULT NULL,
  `outline_file` varchar(1000) DEFAULT NULL,
  `phone_number` varchar(100) DEFAULT NULL,
  `progress_file` varchar(1000) DEFAULT NULL,
  `status` varchar(200) DEFAULT NULL,
  `student_id` varchar(100) DEFAULT NULL,
  `student_name` varchar(200) DEFAULT NULL,
  `term` tinyint DEFAULT NULL,
  `topic_name` varchar(200) DEFAULT NULL,
  `created_by` varchar(100) DEFAULT NULL,
  `instructor` varchar(100) DEFAULT NULL,
  `modified_by` varchar(100) DEFAULT NULL,
  `school_year` bigint DEFAULT NULL,
